# File: content/styleguide/_index.md
cat <<'EOF' > "content/styleguide/_index.md"
---
title: "Style Guide"
description: "Visual validation of Typography, Elements, and Content Types."
type: "styleguide"
sort_by: "date"
sort_order: "desc"
---

## Typography
# Heading 1 (Display)
## Heading 2 (Headline)
### Heading 3 (Title)
#### Heading 4 (Subtitle)
##### Heading 5 (Label)
###### Heading 6 (Small Caps/Overline)

---

## Body Text & Formatting
This is a standard paragraph. It should have **bold text**, *italic text*, ***bold italic text***, and [text links](#). 
We also support `inline code` for technical terms.

> **Blockquote:** This is a blockquote. It should use the primary color for the border and a tinted background.
>
> *It can span multiple lines.*

---

## Lists

### Unordered
* Level 1 Item
* Level 1 Item
    * Level 2 Item
    * Level 2 Item
        * Level 3 Item

### Ordered
1. Step One
2. Step Two
    1. Sub-step A
    2. Sub-step B
3. Step Three

---

## Tables
| Element | Style | Usage |
| :--- | :--- | :--- |
| **Card** | Outlined | Standard Containers |
| **Button** | Pill | Actions |
| **Input** | Rounded | Data Entry |

---

## Content Types
Below this introduction, you should see the list of individual Content Type cards.
EOF

